import React from 'react';
import { View, Image, Text, StyleSheet } from 'react-native';
import { homeBox_one } from '../../utils/HomeData'

const HomePageBox_Two = () => {
    return (
        <View style={styles.box_two}>
            <View style={styles.box_two_heading}>
                <Text style={styles.box_two_Style}>Our Staf</Text>
                <Text style={styles.box_two_btnStyle}>Show All</Text>
            </View>
            <View style={styles.box_two__container}>
                {homeBox_one.map((data) => (
                    <View style={styles.box_t_container_box}>
                        <Text style={{ backgroundColor: 'green', padding: '10px', borderRadius: '10px' }}>
                            <Image source={data.src} style={styles.home_box_img} />
                        </Text>
                        <Text style={styles.home_box_text}>{data.name}</Text>
                    </View>
                ))}
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    box_two: {
        marginTop: '10%'
    },
    box_two_heading: {
        flexDirection: 'row',
        justifyContent: 'space-between',
        padding: "10px",
        marginTop: '10px',
    },
    box_two_Style: {
        color: "#102C56",
        fontSize: '19px',
        lineHeight: "14px",
        letterSpacing: '2%',
        fontWeight: 500,
    },
    box_two_btnStyle: {
        color: "#F98700",
        fontSize: '17px',
        lineHeight: "18px",
        letterSpacing: '2%',
        fontWeight: 500,
    },
    // box_container
    box_two__container: {
        width: '100%',
        flex: 1,
        flexDirection: 'row',
        justifyContent: 'space-arround',
        padding: '10px'
    },
    box_t_container_box: {
        flex: 1,
        flexDirection: 'column',
        alignItems: 'center',
    },
    home_box_img: {
        width: '38px',
        height: '38px',
        opacity: 0.5,
        background: "transparent",
    },
    home_box_text: {
        padding: '10px',
        fontSize: '14px',
        fontWeight: '400',
        color: "#102C56",
        lineHeight: '24px',
    }
})

export default HomePageBox_Two;
